INSERT INTO `wp_2_posts` VALUES (1,1,'2018-05-03 11:45:03','2018-05-03 11:45:03','Welcome to <a href=\"http://localhost.com/\">Multisite Sites</a>. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2018-05-03 11:45:03','2018-05-03 11:45:03','',0,'http://site1.localhost.com/?p=1',0,'post','',1),(2,1,'2018-05-03 11:45:03','2018-05-03 11:45:03','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://site1.localhost.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-05-03 11:45:03','2018-05-03 11:45:03','',0,'http://site1.localhost.com/?page_id=2',0,'page','',0),(5,1,'2018-05-03 12:07:23','2018-05-03 12:07:23','<script type=\"text/javascript\" src=\"/scripts/updatepage.js\"></script>\r\n<script type=\"text/javascript\">\r\nupdatepage();\r\nwindow.alert(\"sometext\");\r\n</script>','','','publish','open','open','','5','','','2018-05-03 12:07:23','2018-05-03 12:07:23','',0,'http://site1.localhost.com/?p=5',0,'post','',0),(6,1,'2018-05-03 12:07:23','2018-05-03 12:07:23','<script type=\"text/javascript\" src=\"/scripts/updatepage.js\"></script>\r\n<script type=\"text/javascript\">\r\nupdatepage();\r\nwindow.alert(\"sometext\");\r\n</script>','','','inherit','closed','closed','','5-revision-v1','','','2018-05-03 12:07:23','2018-05-03 12:07:23','',5,'http://site1.localhost.com/2018/05/03/5-revision-v1/',0,'revision','',0),(10,1,'2018-05-20 13:22:59','2018-05-20 13:22:59','burpburpburpburpburpburpburpburpburpburpburpburpburpburpburp','Test','','publish','open','open','','test','','','2018-05-20 13:24:17','2018-05-20 13:24:17','',0,'http://site1.localhost.com/?p=10',0,'post','',0),(11,1,'2018-05-20 13:22:59','2018-05-20 13:22:59','burpburpburpburpburpburpburpburpburpburpburpburpburpburpburp','Test','','inherit','closed','closed','','10-revision-v1','','','2018-05-20 13:22:59','2018-05-20 13:22:59','',10,'http://site1.localhost.com/2018/05/20/10-revision-v1/',0,'revision','',0);
