INSERT INTO `wp_3_postmeta` VALUES (1,2,'_wp_page_template','default'),(2,1,'_edit_lock','1530606991:1'),(3,1,'_edit_last','1'),(6,1,'simplejspaste_footer','    &lt;script&gt;\r\n      var customLabel = {\r\n        restaurant: {\r\n          label: \'R\'\r\n        },\r\n        bar: {\r\n          label: \'B\'\r\n        }\r\n      };\r\n\r\n        function initMap() {\r\n        var map = new google.maps.Map(document.getElementById(\'map\'), {\r\n          center: new google.maps.LatLng(42.650692, 23.342963),\r\n          zoom: 16\r\n        });\r\n        var infoWindow = new google.maps.InfoWindow;\r\n\r\n\r\n          downloadUrl(\'http://localhost:3000\', function(result) {\r\n            console.log(result);\r\n            Array.prototype.forEach.call(result, function(element) {\r\n              var id = element.id;\r\n              var name = element.name;\r\n              var address = element.address;\r\n              var type = element.type;\r\n              var point = new google.maps.LatLng(\r\n                  parseFloat(element.lat),\r\n                  parseFloat(element.lng));\r\n                  console.log(type)\r\n              var infowincontent = document.createElement(\'div\');\r\n              var strong = document.createElement(\'strong\');\r\n              strong.textContent = name\r\n              infowincontent.appendChild(strong);\r\n              infowincontent.appendChild(document.createElement(\'br\'));\r\n\r\n              var text = document.createElement(\'text\');\r\n              text.textContent = address\r\n              infowincontent.appendChild(text);\r\n              var icon = customLabel[type] || {};\r\n              var marker = new google.maps.Marker({\r\n                map: map,\r\n                position: point,\r\n                label: icon.label\r\n              });\r\n              marker.addListener(\'click\', function() {\r\n                infoWindow.setContent(infowincontent);\r\n                infoWindow.open(map, marker);\r\n              });\r\n            });\r\n          });\r\n        }\r\n\r\n\r\n\r\n      function downloadUrl(url, callback) {\r\n        var xmlhttp = new XMLHttpRequest();\r\n        xmlhttp.onreadystatechange = function() {\r\n            if (this.readyState == 4 &amp;&amp; this.status == 200) {\r\n                var myArr = JSON.parse(this.responseText);\r\n                callback(myArr);\r\n            }\r\n        };\r\n        xmlhttp.open(&quot;GET&quot;, url, true);\r\n        xmlhttp.send();\r\n      }\r\n\r\n      function doNothing() {}\r\n    &lt;/script&gt;\r\n    &lt;script async defer\r\n    src=&quot;https://maps.googleapis.com/maps/api/js?key=AIzaSyBiTBKcAUdG9VYCS4wo7Og4DGHIMGnmojc&amp;callback=initMap&quot;&gt;\r\n    &lt;/script&gt;'),(7,5,'simplejspaste_footer',''),(8,5,'_edit_lock','1528282304:1'),(9,5,'_edit_last','1'),(11,37,'simplejspaste_footer',''),(12,37,'_edit_lock','1529999193:1'),(13,37,'_edit_last','1'),(14,37,'_wp_trash_meta_status','publish'),(15,37,'_wp_trash_meta_time','1530607086'),(16,37,'_wp_desired_post_slug','map'),(17,5,'_wp_trash_meta_status','publish'),(18,5,'_wp_trash_meta_time','1530607088'),(19,5,'_wp_desired_post_slug','please-work'),(24,53,'_edit_lock','1530686436:1'),(25,53,'_edit_last','1'),(38,61,'_edit_lock','1530609500:1'),(39,61,'_edit_last','1'),(42,64,'_edit_lock','1530616791:1'),(43,64,'_edit_last','1'),(44,64,'_wp_trash_meta_status','publish'),(45,64,'_wp_trash_meta_time','1530686314'),(46,64,'_wp_desired_post_slug','error');
