INSERT INTO `wp_posts` VALUES (1,1,'2018-05-03 10:31:49','2018-05-03 10:31:49','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-05-03 10:31:49','2018-05-03 10:31:49','',0,'http://localhost.com/?p=1',0,'post','',1),(2,1,'2018-05-03 10:31:49','2018-05-03 10:31:49','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-05-03 10:31:49','2018-05-03 10:31:49','',0,'http://localhost.com/?page_id=2',0,'page','',0),(3,1,'2018-05-03 10:31:56','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-05-03 10:31:56','0000-00-00 00:00:00','',0,'http://localhost.com/?p=3',0,'post','',0),(4,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','','Espresso','','auto-draft','open','closed','','','','','2018-05-20 13:11:30','0000-00-00 00:00:00','',0,'http://localhost.com/wp-content/uploads/2018/05/espresso.jpg',0,'attachment','image/jpeg',0),(5,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','','Sandwich','','auto-draft','open','closed','','','','','2018-05-20 13:11:31','0000-00-00 00:00:00','',0,'http://localhost.com/wp-content/uploads/2018/05/sandwich.jpg',0,'attachment','image/jpeg',0),(6,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','','Coffee','','auto-draft','open','closed','','','','','2018-05-20 13:11:31','0000-00-00 00:00:00','',0,'http://localhost.com/wp-content/uploads/2018/05/coffee.jpg',0,'attachment','image/jpeg',0),(7,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.','Home','','auto-draft','closed','closed','','','','','2018-05-20 13:11:32','0000-00-00 00:00:00','',0,'http://localhost.com/?page_id=7',0,'page','',0),(8,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','You might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.','About','','auto-draft','closed','closed','','','','','2018-05-20 13:11:32','0000-00-00 00:00:00','',0,'http://localhost.com/?page_id=8',0,'page','',0),(9,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','This is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.','Contact','','auto-draft','closed','closed','','','','','2018-05-20 13:11:32','0000-00-00 00:00:00','',0,'http://localhost.com/?page_id=9',0,'page','',0),(10,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','','Blog','','auto-draft','closed','closed','','','','','2018-05-20 13:11:32','0000-00-00 00:00:00','',0,'http://localhost.com/?page_id=10',0,'page','',0),(11,1,'2018-05-20 13:11:32','0000-00-00 00:00:00','This is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.','A homepage section','','auto-draft','closed','closed','','','','','2018-05-20 13:11:32','0000-00-00 00:00